import React, { Component } from 'react';
import '../component-styles/project.css'
import Slider from "react-slick";
class ProjectsCard extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll:3
    };
    return (
      <div id='project-main-card-container'> 
      <Slider {...settings}>
      <div className='project-card-container'><div>1 </div> </div> 
      <div className='project-card-container'>2</div> 
      <div className='project-card-container'>3</div> 
      <div className='project-card-container'>4</div> 
      <div className='project-card-container'>5</div> 
      <div className='project-card-container'>6</div> 
      <div className='project-card-container'>7</div> 
      <div className='project-card-container'>8</div> 
      <div className='project-card-container'>9</div> 
      </Slider>
    </div>
    );
  }
}

export default  ProjectsCard ;
